DROP TABLE IF EXISTS customer_account CASCADE;
DROP TABLE IF EXISTS transactions CASCADE;
DROP TABLE IF EXISTS characters CASCADE;
DROP TABLE IF EXISTS spells_known CASCADE;
DROP TABLE IF EXISTS spells CASCADE;
DROP TABLE IF EXISTS inventory CASCADE;
DROP TABLE IF EXISTS items CASCADE;
DROP TABLE IF EXISTS weapons CASCADE;
DROP TABLE IF EXISTS armor CASCADE;
DROP TABLE IF EXISTS parties CASCADE;
DROP TABLE IF EXISTS encounters CASCADE;
DROP TABLE IF EXISTS monsters CASCADE;

CREATE TABLE customer_account
                    (id            SERIAL PRIMARY KEY,
                    username       VARCHAR(100) NOT NULL,
                    name           VARCHAR(45) NOT NULL,
                    email          VARCHAR(45) NOT NULL,
                    password       VARCHAR(45) NOT NULL,
                    payment_rate   VARCHAR(10) NOT NULL
                    );
CREATE TABLE parties
                    (id                SERIAL PRIMARY KEY,
                    name               VARCHAR(100) NOT NULL
                    );
CREATE TABLE transactions
                    (id              SERIAL PRIMARY KEY,
                    customer_id      INT NOT NULL,
                    amount           VARCHAR(45) NOT NULL,
                    _date            DATE NOT NULL,
                    status           VARCHAR(45) NOT NULL,
                    CONSTRAINT       customer_id_fk
                        FOREIGN KEY(customer_id)
                        REFERENCES customer_account(id)
                    );
CREATE TABLE characters
                    (id               SERIAL PRIMARY KEY,
                    name              VARCHAR(100) NOT NULL,
                    party_id          INT NOT NULL,
                    customer_id       INT NOT NULL,
                    race              VARCHAR(45) NOT NULL,
                    _class             VARCHAR(45) NOT NULL,
                    _level             VARCHAR(45) NOT NULL,
                    _size              VARCHAR(45) NOT NULL,
                    CONSTRAINT        party_id_fk
                        FOREIGN KEY(party_id)
                        REFERENCES parties(id),
                    CONSTRAINT        customer_id_fk
                        FOREIGN KEY(customer_id)
                        REFERENCES customer_account(id)
                    );
CREATE TABLE spells
                    (id                  SERIAL PRIMARY KEY,
                    name                 VARCHAR(100) UNIQUE NOT NULL,
                    spell_level          INT NOT NULL,
                    description          VARCHAR(300) NOT NULL
                    );
CREATE TABLE spells_known
                    (character_id     INT NOT NULL,
                    spell_id          INT NOT NULL,
                    CONSTRAINT        character_id_fk
                        FOREIGN KEY(character_id)
                        REFERENCES characters(id),
                    CONSTRAINT       spell_id_fk
                        FOREIGN KEY(spell_id)
                        REFERENCES spells(id),
                    PRIMARY KEY (character_id, spell_id)
                    );
CREATE TABLE items
                    (id                 SERIAL,
                    name                VARCHAR(100) UNIQUE NOT NULL,
                    description         VARCHAR(300) NOT NULL
                    PRIMARY KEY(id, name, description)
                    );
CREATE TABLE weapons
                    (id                 INT NOT NULL,
                    name                VARCHAR(100) NOT NULL,
                    description         VARCHAR(300) NOT NULL,
                    properties          VARCHAR(100) NOT NULL,
                    damage_die          VARCHAR(10) NOT NULL,
                    damage_type         VARCHAR(45) NOT NULL,
                    CONSTRAINT        item_id_fk
                        FOREIGN KEY(id)
                        REFERENCES items(id),
                    CONSTRAINT        name_fk
                        FOREIGN KEY(name)
                        REFERENCES items(name),
                    CONSTRAINT        desc_fk
                        FOREIGN KEY(description)
                        REFERENCES items(description),
                    PRIMARY KEY(id, name, description)
                    );
CREATE TABLE armor
                    (id                INT NOT NULL,
                    name               VARCHAR(100) NOT NULL,
                    description        VARCHAR(300) NOT NULL,
                    _type              VARCHAR(45) NOT NULL,
                    bonus              VARCHAR(45),
                    resistance         VARCHAR(45),
                    CONSTRAINT        item_id_fk
                        FOREIGN KEY(id)
                        REFERENCES items(id),
                    CONSTRAINT        name_fk
                        FOREIGN KEY(name)
                        REFERENCES items(name),
                    CONSTRAINT        desc_fk
                        FOREIGN KEY(description)
                        REFERENCES items(description),
                    PRIMARY KEY(id, name, description)
                    );
CREATE TABLE inventory
                    (character_id      INT NOT NULL,
                    item_id           INT NOT NULL,
                    quantity          INT NOT NULL,
                    CHECK(quantity > 0),
                    CONSTRAINT        character_id_fk
                        FOREIGN KEY(character_id)
                        REFERENCES characters(id),
                    CONSTRAINT        item_id_fk
                        FOREIGN KEY(item_id)
                        REFERENCES items(id),
                    PRIMARY KEY (character_id,item_id)
                    );
CREATE TABLE monsters
                    (id                SERIAL PRIMARY KEY,
                    name               VARCHAR(100) NOT NULL,
                    hit_points         INT,
                    exp_points         INT,
                    CHECK(hit_points > 0),
                    CHECK(exp_points > 0)
                    );
CREATE TABLE encounters
                    (party_id          INT NOT NULL,
                    monster_id         INT NOT NULL,
                    monster_deaths     INT NOT NULL,
                    CHECK(monster_deaths > 0),
                    CONSTRAINT        party_id_fk
                        FOREIGN KEY(party_id)
                        REFERENCES parties(id),
                    CONSTRAINT        monster_id_fk
                        FOREIGN KEY(monster_id)
                        REFERENCES monsters(id)
                    );
